import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { fetchTreatments, fetchInjuries } from '../api/fetchPatientDetails';

const Treatment = () => {
  const { patientId } = useParams();
  const [treatments, setTreatments] = useState([]);
  const [injuries, setInjuries] = useState([]);
  const [activeTab, setActiveTab] = useState('treatments');

  useEffect(() => {
    const getPatientDetails = async () => {
      const treatmentData = await fetchTreatments(patientId);
      const injuryData = await fetchInjuries(patientId);
      setTreatments(treatmentData);
      setInjuries(injuryData);
    };
    getPatientDetails();
  }, [patientId]);

  const toggleTab = (tabName) => {
    setActiveTab(tabName);
  };

  const handleCure = async (injuryId) => {
    // 治癒ステータスを更新するための処理
    console.log(`治癒ボタンが押されました: ${injuryId}`);
    // 実際の更新処理を後ほど追加します
  };

  return (
    <div>
      <h2>患者詳細ページ</h2>

      <div>
        <button onClick={() => toggleTab('treatments')}>施術履歴</button>
        <button onClick={() => toggleTab('injuries')}>受傷履歴</button>
      </div>

      {activeTab === 'treatments' && (
        <div>
          <h3>施術履歴</h3>
          {treatments.length > 0 ? (
            <table>
              <thead>
                <tr>
                  <th>日付</th>
                  <th>内容</th>
                  <th>部位</th>
                </tr>
              </thead>
              <tbody>
                {treatments.map((treatment) => (
                  <tr key={treatment.id}>
                    <td>{treatment.date}</td>
                    <td>{treatment.content}</td>
                    <td>{treatment.body_part}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>施術履歴がありません。</p>
          )}
        </div>
      )}

      {activeTab === 'injuries' && (
        <div>
          <h3>受傷履歴</h3>
          {injuries.length > 0 ? (
            <table>
              <thead>
                <tr>
                  <th>日付</th>
                  <th>部位</th>
                  <th>痛みレベル</th>
                  <th>治癒状態</th>
                  <th>操作</th>
                </tr>
              </thead>
              <tbody>
                {injuries.map((injury) => (
                  <tr key={injury.id}>
                    <td>{injury.date}</td>
                    <td>{injury.body_part}</td>
                    <td>{injury.pain_level}</td>
                    <td>{injury.is_healed ? '完治' : '治療中'}</td>
                    <td>
                      {!injury.is_healed && (
                        <button onClick={() => handleCure(injury.id)}>治癒</button>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>受傷履歴がありません。</p>
          )}
        </div>
      )}
    </div>
  );
};

export default Treatment;
